<template>
    <div>
       ExeChild02
       <canvas id="myCanvas" width="800" height="600"></canvas>
       <div id="images"></div>
       <button @click="Draw">Draw</button>
    </div>
</template>

<script>
    export default {
        name: "ExeChild02",
        data() {
            return {
               loadTimer: "",
               imgObject: "",
               canvas: ""
            }
        },
        created(){
            
        },
        methods: {
            Draw(){
                console.log('=====');
                this.imgObject = new Image();
                this.canvas=document.getElementById('myCanvas');
                this.imgObject.src = `data:image/jpeg;base64,`;
                this.imgObject.onLoad = this.onImgLoaded()
            },
            // 
            onImgLoaded() {
                let that = this;
                if (that.loadTimer != null) clearTimeout(that.loadTimer);
                if (!that.imgObject.complete) {
                    that.loadTimer = setTimeout(function() {
                        that.onImgLoaded();
                    }, 3);
                } else {
                    that.onPreloadComplete();
                }
            },
            // 
            onPreloadComplete(){
                //call the methods that will create a 64-bit version of thumbnail here.
                var newImg = this.getImagePortion(this.imgObject, 120, 150, 150, 80, 2);
                          console.log(newImg, "================")

                //place image in appropriate div
                document.getElementById("images").innerHTML = "<img alt='' src="+newImg+" />";
            },
            //  
            getImagePortion(imgObj, newWidth, newHeight, startX, startY, ratio){
                /* the parameters: - the image element - the new width - the new height - the x point we start taking pixels - the y point we start taking pixels - the ratio */
                //set up canvas for thumbnail
                var tnCanvas = document.createElement('canvas');
                var tnCanvasContext = tnCanvas.getContext('2d');
                tnCanvas.width = newWidth; tnCanvas.height = newHeight;
                
                /* use the sourceCanvas to duplicate the entire image. This step was crucial for iOS4 and under devices. Follow the link at the end of this post to see what happens when you dont do this */
                var bufferCanvas = document.createElement('canvas');
                var bufferContext = bufferCanvas.getContext('2d');
                bufferCanvas.width = imgObj.width;
                bufferCanvas.height = imgObj.height;
                bufferContext.drawImage(imgObj, 0, 0);
                
                /* now we use the drawImage method to take the pixels from our bufferCanvas and draw them into our thumbnail canvas */
                tnCanvasContext.drawImage(bufferCanvas, startX,startY,newWidth * ratio, newHeight * ratio,0,0,newWidth,newHeight);
                // tnCanvasContext.toDataURL("image/jpeg", 0.5);
                return tnCanvas.toDataURL("image/jpeg", 0.5);
                // tnCanvas.toDataURL();
            }


        },
        model: {
           
        },
        props: {
            
        }

    }
</script>